  "privacy_content": "<h2>Tietosuojaseloste</h2> <p>Tätä tietosuojailmoitusta sovelletaan PharmaLedger Association Electronic Product Information -tuotteen käyttöön. </p> <h2>Yhteystiedot</h2><ul class=\"list-space\" role=\"list\"><li role=\"listitem\"><b>a) Rekisterinpitäjän tai yhteisten rekisterinpitäjien henkilöllisyys ja yhteystiedot</b><p>Tietojesi rekisterinpitäjä on PharmaLedger Association.</p></li><li role=\"listitem\"><b>b) Tietosuojavastaavan yhteystiedo</b><p>PharmaLedger Associationin tietosuojatoimisto on tavoitettavissa osoitteesta dpo@pharmaledger.org.</p></li></ul><h2>Mitä henkilötietoja käytämme</h2><p>Keräämme vain sähköisen esitteen toimittamiseen tarvittavat tekniset tiedot. Näihin kuuluvat IP-osoitteesi sekä sen laitteen ja selaimen tekniset tunnisteet, jota käytät sovellustamme käyttäessäsi.</p> <p><em>Keräämme yksityiskohtaisesti seuraavat tietoelementit:</em></p><ul><li><p><em>Mobiililaitteen käyttöoikeus.</em> Saatamme pyytää pääsyä tai lupaa tiettyihin mobiililaitteesi ominaisuuksiin, kuten mobiililaitteesi kameraan ja muihin ominaisuuksiin. Jos haluat muuttaa käyttöoikeuksia tai -lupia, voit tehdä sen laitteesi asetuksissa.</p></li><li><p><em>Mobiililaitteen tiedot.</em> Keräämme automaattisesti laitetietoja (kuten mobiililaitteesi tunniste (ID), malli ja valmistaja), käyttöjärjestelmä-, versio- ja järjestelmän kokoonpanotietoja, laitteen ja sovelluksen tunnistenumeroita, selaimen tyyppiä ja versioita, laitteistomallia, Internet-palveluntarjoajaa ja/tai matkaviestinoperaattoriasekä Internet-protokollaosoitetta(IP-osoitetta) (tai välityspalvelinta) koskevia tietoja. Jos käytät sovellustamme (sovelluksiamme), saatamme myös kerätä tietoja mobiililaitteeseesi liitetystä puhelinverkosta, mobiililaitteesi käyttöjärjestelmästä tai alustasta, käyttämäsi mobiililaitteen tyypistä, mobiililaitteesi yksilöllisestä laitetunnnisteesta ja tietoja sovelluksemme (sovellustemme) ominaisuuksista, joita käytit.</p></li></ul><h2>Miksi keräämme henkilötietojasi</h2><h3>Tarkoitukset</h3><p>Keräämme teknisiä tietojasi, jotta voimme toimittaa sinulle lääkkeesi sähköisen pakkausselosteen.</p><p>Siten voimme vedota seuraaviin oikeusperusteisiin käsitellessämme  henkilötietojasi:</p><ul><li><p><b>Sopimuksen toteuttaminen.</b> Voimme käsitellä henkilötietojasi, kun uskomme sen olevan tarpeen täyttääksemme sopimusvelvoitteet sinua kohtaan, mukaan lukien palveluidemme tarjoaminen, tai pyynnöstäsi ennen sopimuksen tekemistä kanssasi.</p></li><li><p><b>Lailliset velvoitteet.</b> Voimme käyttää tietojasi, jos uskomme, että se ontarpeen lakisääteisten velvoitteidemme noudattamiseksi, kuten terveydenhuollon sääntelyn ja kansanterveyslainsäädännön mukaisten velvoitteidemme täyttämiseksi.</p></li></ul><h2>Kenen kanssa jaamme henkilötietojasi</h2><p>Jäsenyritykset ja kolmannen osapuolen palveluntarjoajat.</p><p>Jaamme tietojasi kolmansien osapuolten myyjien, palveluntarjoajien, urakoitsijoiden tai edustajien (\"kolmannet osapuolet\") kanssa, jotka tuottavat palveluita meille tai puolestamme ja tarvitsevat pääsyn näihin tietoihin voidakseen tehdä työnsä. Meillä on kolmansien osapuolten kanssa sopimuksia, joiden tarkoituksena on auttaa suojaamaan henkilötietojasi. Tämä tarkoittaa sitä, että ne eivät voi tehdä mitään henkilötiedoillesi, ellemme ole antaneet niille ohjeita. Ne eivät myöskään jaa henkilötietojasi minkään muun organisaation kanssa kuin meidän. Ne sitoutuvat myös suojaamaan puolestamme hallussaan pitämiään tietoja ja säilyttämään niitä ohjeistamamme ajan. Seuraaviin ryhmiin kuuluvat kolmannet osapuolet, joiden kanssa voimme jakaa henkilötietoja:</p><ul><li><p>Lääkkeiden valmistajat (jäsenyritykset)</p></li><li><p>Teknisten palvelujen tuottaja</p></li></ul><h2>Kuinka kauan säilytämme henkilötietojasi</h2><p>PharmaLedger Association säilyttää teknisiä tietojasi vain niin kauan kuin se on tarpeen pakkausselostepyyntösi käsittelemiseksi, enintään 30 päivän ajan.</p><p>Lääkevalmistajasi säilyttää tietojasi myös määritellyn ajanjakson ajan, joka määräytyy heidän tietojen säilytyskäytäntöjensä mukaisesti; lisätietoja tästä säilytyksestä saat ottamalla yhteyttä lääkkeen valmistajaan.</p><h2>Jos et anna meille henkilötietojasi</h2><p>Jos et anna meille teknisiä tietojasi, emme pysty täyttämään pakkausselostetta koskevaa pyyntöäsi.</p><h2>Oikeutesi</h2><p>Jos sinulla on tietosuoja asetuksen mukaisia henkilötietoihisi liittyviä pyyntöjä, kuten pyyntö saada pääsy tietoihin tai poistaa ne, voit ottaa meihin yhteyttä osoitteessa dpo@pharmaledger.org.</p><p>Käsittelemme tällaiset pyynnöt 30 päivän kuluessa.</p><h2>Suostumuksen peruuttaminen</h2><p>Jos sinulla on tietosuoja-asetuksen mukaisia henkilötietoihisi liittyviä pyyntöjä, kuten pyyntö saada pääsy tietoihin tai poistaa ne, voit ottaa meihin yhteyttä osoitteessa dpo@pharmaledger.org.</p><p>Käsittelemme tällaiset pyynnöt 30 päivän kuluessa.</p><h2>Automatisoitu päätöksenteko</h2><p>Emme käytä automaattista päätöksentekoa tarjotessamme sinulle tätä palvelua.</p><h2>Henkilötietojen kansainväliset siirrot</h2><p>Jos lääkkeen valmistaja vaatii meitä siirtämään tietojasi Euroopan unionin ulkopuolelle, käytämme vakiosopimuslausekkeita tietojesi suojaamiseksi.</p><h2>Kuinka tehdä valitus</h2><p>Jos sinulla on tietosuoja-asetuksen mukaisia henkilötietoihisi liittyviä pyyntöjä, kuten pyyntö saada pääsy tietoihin tai poistaa ne, voit ottaa meihin yhteyttä osoitteessa dpo@pharmaledger.org.</p><p>Käsittelemme tällaiset pyynnöt 30 päivän kuluessa. Lisäksi voit ottaa yhteyttä paikalliseen valvontaviranomaiseen, jos sinusta tuntuu, että oikeuksiasi ei noudateta.</p>",
