  "terms_content": "<h2>PharmaLedger Associationin sähköisen tuotetietosivuston ja - sovelluksen käyttöehdot.</h2><p>Kun käytät PharmaLedger Associationin sähköisiä tuotetietoja sisältävää verkkosivustoa ja sovellusta (\"Palvelut\"), sitoudut noudattamaan näitä käyttöehtoja (\"Ehdot\"). Et voi käyttää palveluita, jos et hyväksy näitä ehtoja. Palveluita ylläpitää PharmaLedger Association (\"Yhdistys\"), ja ne on tarkoitettu lääkitystietoa etsivien henkilöiden käyttöön. Usean osapuolen verkosto toimittaa Palvelut, ja lääkkeen valmistaja toimittaa Palveluissa näkyvät tuotetiedot. Yhdistys toimii näiden tietojen rekisterinpitäjänä. </p><h2>Palveluiden käyttö </h2><p>Käyttäjä sitoutuu käyttämään Palveluita ainoastaan laillisiin tarkoituksiin ja tavalla, joka ei loukkaa minkään kolmannen osapuolen oikeuksia tai rajoita tai estä minkään kolmannen osapuolen Palveluiden käyttöä tai niistä nauttimista. Tällaiseen rajoittamiseen tai estämiseen kuuluu rajoituksetta toiminta, joka on laitonta tai joka voi ahdistella tai aiheuttaa ahdistusta tai haittaa kenelle tahansa henkilölle, sekä säädyttömän tai loukkaavan sisällön lähettäminen tai Palveluiden normaalin dialogin kulun häiritseminen. </p><h2>Immateriaalioikeudet</h2><p>Palveluiden sisältö, mukaan lukien muun muassa teksti, grafiikka, kuvat ja ohjelmistot, on yhdistyksen tai sen lisenssinantajien ja jäsenyritysten omaisuutta, ja sitä suojaavat tekijänoikeudet ja muut immateriaalioikeudet. Palveluiden sisältöä ei saa käyttää mihinkään kaupalliseen tarkoitukseen ilman yhdistyksen nimenomaista kirjallista suostumusta.</p><h2>Vastuu</h2><p>Yhdistys ei anna minkäänlaisia, nimenomaisia tai epäsuoria vakuutuksia tai takuita Palveluiden toiminnasta tai Palveluihin sisältyvistä tiedoista, sisällöstä, materiaaleista tai tuotteista. Yhdistys ei ole vastuussa mistään Palveluiden käytöstä aiheutuvista vahingoista, mukaan lukien, mutta ei rajoittuen, suorat, epäsuorat, satunnaiset, rangaistusluonteiset ja välilliset vahingot.</p><h2>Sovellettava laki</h2><p>Näihin ehtoihin ja Palveluiden käyttöösi sovelletaan Sveitsin lakeja ja niitä tulkitaan Sveitsin lakien mukaisesti, ja mahdolliset riidat ratkaistaan Baselissa, Sveitsissä sijaitsevissa tuomioistuimissa.</p><h2>Muutokset ehtoihin</h2><p>Yhdistys pidättää oikeuden muuttaa näitä ehtoja milloin tahansa, ja sinun on tarkistettava nämä ehdot säännöllisesti mahdollisten muutosten varalta. Palveluiden käytön jatkaminen sen jälkeen, kun Ehtoihin on tehty muutoksia, merkitsee korjattujen Ehtojen hyväksymistä.</p><p><br></p>",
