  "about_content": "<h2>Tietoja tästä sovelluksesta</h2><p>Tämän sovelluksen sinulle tarjoaa PharmaLedger®. Sen ovat kehittäneet yhdessä potilaita edustavat järjestöt, lääkeyritykset ja teknologia-asiantuntijat.</p><p>Sen avulla sovelluksen käyttäjät voivat tarkastella tietoja lääkkeestään skannaamalla tuotepakkauksen viivakoodin.</p><p>Näytetyt tiedot ovat tuotteen myyntiluvan haltijan toimittamia.</p><h2>Tietoja PharmaLedgeristä</h2><p>PharmaLedger® on PharmaLedger Associationin (PLA) tuotemerkki.</p><p>PLA on maailmanlaajuinen voittoa tavoittelematon ja riippumaton yhdistys. Yhdistyksen tarkoituksena on kehittää ja edistää digitaalissen luottamuksen ekosysteemiä terveydenhuollossa.</p><p>Yhdistys edistää yhteistyötä terveydenhuollon ja biotieteiden aloilla sekä edistää innovaatioita ja niiden käyttöönottoa potilaiden ja muiden sidosryhmien yhteiseksi hyödyksi.</p>",
