  "help_content": "<div><p><b><h2>Mikä on EPI? </h2></b></p><p> <b>EPI</b> on lyhenne sanoista <b> electronic product information.</b> Se on sähköinen versio paperisesta Pakkausselosteesta, joka on tyypillisesti lääkevalmistepakkauksen sisällä. Joissakin tapauksissa <b>EPI</b> on saattanut korvata paperisen tuoteselosteen.</p><p><b><h2>Mikä PharmaLedger on? </h2></b></p><p>PharmaLedger Association (PLA) on sveitsiläinen voittoa tavoittelematon yhdistys, jonka tarkoituksena on mahdollistaa ja edistää terveydenhuollon digitaalisen luottamuksen ekosysteemiä standardoidun ja luotettavan avoimen lähdekoodin alustan avulla. PLA edistää yhteistyötä ja nopeuttaa innovointia ja käyttöönottoa yhteisten etujen saavuttamiseksi terveydenhuollon ja biotieteiden aloilla potilaiden ja muiden sidosryhmien hyväksi. PLA perustettiin vuonna 2022 jatkamaan Euroopan komission ja lääketeollisuuden rahoittaman kolmivuotisen PharmaLedger-hankkeen työtä, jonka tavoitteena on todistaa lohkoketjuratkaisujen hyöty. Lisätietoja on saatavilla osoitteessa https://pharmaledger.org. </p><p><b><h2>Mikä on DataMatrix? </h2></b></p><p>Se on eräänlainen viivakoodi tuotepakkauksessa. Se on mustavalkoinen neliönmuotoinen laatikkoviivakoodi, ja se näyttää samankaltaiselta kuin tämä: <br><img src=\"./images/barcode_example.png\" alt='DataMatrix barcode example'></p><p><b><h2>Miten sovellusta käytetään? </h2></b></p><p> Seuraa sovelluksen aloitussivulla olevia ohjeita... se näyttää kuvan siitä, mistä DataMatrix löytyy tuotepaketistasi. Kun olet löytänyt <b>DataMatrixin,</b> napsauta painiketta \"Skannaa <b>DataMatrix</b>\". Anna sovellukselle lupa käyttää kameraa, jotta <b>DataMatrix</b> voidaan skannata. Tarkenna kamera <b>DataMatrixiin</b>. Kun pakkaus on skannattu onnistuneesti, <b>EPI</b> tulee näkyviin. Voit napsauttaa '+' -painiketta saadaksesi lisätietoja. </p><p><b><h2>Miksi DataMatrix-skannaus ei tuota tulosta? </h2></b></p><p>On useita syitä, miksi paketin <b>DataMatrix</b> ei välttämättä näytä EPI:tä. Yksi syy voi olla kameran tarkennus. Yritä skannata koodi hyvin valaistussa paikassa, jossa koodi näkyy selvästi näytöllä. Jos sinulla on vaikeuksia pitää kätesi vakaana, voit yrittää tukea kätesi pöytää vasten.</p> </div>",
